
public class Address {

	private String key;
	
	private String text;
	
	public Address() {
		// TODO Auto-generated constructor stub
	}
	
	public Address(String key,String text) {
		// TODO Auto-generated constructor stub
		this.key = key;
		this.text =text;
	}

	public String getKey() {
		return key;
	}

	public void setKey(String key) {
		this.key = key;
	}

	public String getText() {
		return text;
	}

	public void setText(String text) {
		this.text = text;
	}
	
	
}
